import React from "react";

const RecentItems = () => {
  return (
    <div className="recent-item">
      <div className="recent-img-container">
        <img src={require("../images/activity.jpg")} alt="Activity Sample" />
      </div>
      <h4>December 29, 2019</h4>
      <p>
        Hoarded more than 20 books for YP members. It's 11 weeks remaining to
        meet the Twenty-book challenge for the 13th reading season. Double time
        participants, if you're aiming for gold. Happy reading!!
      </p>
      <p className="primary-btn">Read More</p>
    </div>
  );
};

export default RecentItems;
